import React from "react";
import { Title, LoginTextField, LoginButton } from "./Materials";
import { Link } from "react-router-dom";
import { Typography } from "@material-ui/core";
import { config } from "../../config/Config";
import { PublicClientApplication } from '@azure/msal-browser';
import GoogleLogin from 'react-google-login'


const Home = () => {

  window.gapi.load('auth2', function (){
    gapi.auth2.init();
  });

  function handleClick() {
    console.log("wroked");
    window.Email.send({
        Host : "smtp.elasticemail.com",
        Username : "williamchan@rogers.com",
        Password : "29ADB4099B42435A27EEA948235106C269C2",
        To : 'williamchan@rogers.com',
        From : "williamchan@rogers.com",
        Subject : "This is the subject",
        Body : "And this is the body"
    }).then(
      message => alert(message)
    );
  }
  return (
    <div class="h-full">
      <form
        class="h-full flex flex-wrap content-center justify-center flex-col"
        noValidate
        autoComplete="off"
      >
        <div class="text-center">
          <Title variant="h2" colorPrimary="white">
            AutoSend
          </Title>
        </div>
        <div class="w-96 mt-5">
          <LoginTextField label="Email" variant="outlined" fullWidth="true" />
        </div>
        <div class="w-96 mt-3">
          <LoginTextField
            type="password"
            label="Password"
            variant="outlined"
            fullWidth="true"
          />
        </div>
        <GoogleLogin/>
        {/* <div class="w-96 mt-3 text-right">
          <Link to="/email">
            <LoginButton onClick={handleClick.bind()} variant="contained">Login</LoginButton>
          </Link>
        </div> */}
      </form>
    </div>
  );
};

export default Home;
